<!DOCTYPE html>
<html lang="pt-br">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <link rel="stylesheet" href="./static/css/styles.css" />
    <title>Slides</title>
</head>

<body>
    <?php

    require_once('vendor/autoload.php');
    $dotenv = Dotenv\Dotenv::createImmutable(__DIR__);
    $dotenv->load();

    $i = 0;
    $limit = 4;
    $token = $_ENV['TOKEN'];
    $uri = 'https://graph.instagram.com/me/media?access_token=' . $token . '&fields=media_url,media_type,caption,permalink&limit=' . $limit;
    $ch = curl_init($uri);
    curl_setopt($ch, CURLOPT_RETURNTRANSFER, TRUE);
    $posts = json_decode(curl_exec($ch));

    ?>
    <div class="feed">
        <div class="posts">
            <div class="posts__caption">
                <svg width="100" height="100" viewBox="0 0 39 39" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                    <g clip-path="url(#clip0_415_157)">
                        <rect width="39" height="39" fill="url(#pattern0)" />
                    </g>
                    <defs>
                        <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
                            <use xlink:href="#image0_415_157" transform="scale(0.00138889)" />
                        </pattern>
                        <clipPath id="clip0_415_157">
                            <rect width="39" height="39" rx="19.5" fill="white" />
                        </clipPath>
                        <image id="image0_415_157" width="720" height="720" xlink:href="data:image/png;base64," />
                    </defs>
                </svg>
            </div>
            <div class="posts__slides">
                <?php foreach ($posts->data as $post) : ?>
                    <?php if ($i == 0) : ?>
                        <div class="slides__div first">
                            <a href="<?= $post->permalink ?>" target="__blank">
                                <img src="<?= $post->media_url ?>">
                            </a>
                        </div>
                    <?php else : ?>
                        <div class="slides__div">
                            <a href="<?= $post->permalink ?>" target="__blank">
                                <img src="<?= $post->media_url ?>">
                            </a>
                        </div>
                    <?php endif; ?>
                    <?php $i++; ?>
                <?php endforeach; ?>
            </div>
        </div>
        <div class="navigation">
            <form action="#" class="navigation__form">
                <div>
                    <input type="radio" id="post1" name="post" checked value="0">
                    <label for="post1"></label>
                </div>
                <div>
                    <input type="radio" id="post2" name="post" value="1">
                    <label for="post2"></label>
                </div>
                <div>
                    <input type="radio" id="post3" name="post" value="2">
                    <label for="post3"></label>
                </div>
                <div>
                    <input type="radio" id="post4" name="post" value="3">
                    <label for="post4"></label>
                </div>
            </form>
        </div>
    </div>

    <script src="./static/js/slider.js"></script>
</body>

</html>